void csr_mat_mul_test(int *row_ptr, int *col_idx, int8_t *data_arr) {
    cout << "CSR buffer filling\n";
    int32_t row_A = 32, col_A;
    int32_t row_B = 1, col_B;
    int16_t output_data[ROWS_A * ROWS_B];
    int16_t *input_ptr, *output_ptr;
    int64_t *bias = NULL;
    Timer timer;
    timer.start();
    for (int i = 0; i < ROWS_B; i++) {
        col_A = col_B = (row_ptr[i + 1] - row_ptr[i]);
        int16_t input[row_A * col_A];
        int8_t weight[col_B];
        for (int j = row_ptr[i]; j < row_ptr[i + 1]; j++) {
            weight[j - row_ptr[i]] = data_arr[j];
            for (int k = 0; k < row_A; k++) {
                input[k * col_A + (j - row_ptr[i])] = input_data[k * COLS_A + col_idx[j]];
            }
        }
        input_ptr = input;
        output_ptr = output_data + i * row_B;
        for (int j = 0; j < row_A; j++) {
            arm_nn_vec_mat_mult_t_s16(input_ptr,
                                      weight,
                                      bias,
                                      output_ptr,
                                      0,
                                      0,
                                      col_B,
                                      row_B,
                                      INT16_MIN,
                                      INT16_MAX);
            input_ptr += col_A;
            output_ptr += ROWS_B;
        }
    }
    timer.stop();
    cout << "Execution time: " << timer.read_us() << "us\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[i] << ' ';
    }
    cout << "\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[ROWS_B * 28 + i] << ' ';
    }
    cout << "\n\n";
    return;
}
